      <div className="header-info" style={{marginLeft: '1rem', display: 'flex', justifyContent: 'center', flexDirection: 'column'}}>
        <h1 style={{ fontSize: '3rem' }}>SweetEst</h1>
        <p style={{fontSize: '1rem', textAlign: 'center'}}>Անվճար առաքում</p>
        <p style={{ fontSize: '1rem' }}>հեռ․ +37498107711</p>

      </div>
      <nav style={{ marginLeft: 'auto' }}>
        <ul style={{ display: 'flex', listStyle: 'none' }}>
